import React from "react";
import CheckBox from "./CheckBox";
const checkboxes = [
  "Include Uppercase Letters",
  "Include Lowercase Letters",
  "Include Numbers",
  "Include Symbols",
];
const Checkboxes = () => {
  return (
    <div>
      {checkboxes.map((checkbox) => {
        return <CheckBox content={checkbox}></CheckBox>;
      })}
    </div>
  );
};

export default Checkboxes;
